	expt2 := "D1FA080F923E9CA7D76341E25E476DF23309EDA69AA761B6DEDC9AC2D8021D8AD8B0F17CF902FDB8394F2C0C935AA6F5049930A156D2DE7A997A1713698BAED2"
	sh2 := HashAES512ToUpper(s2)
	t.Logf("src=[%s]\n", s2)
